from django.contrib import adminfrom ..models import PythonTipLink@admin.register(PythonTipLink)class PythonTipLinkAdmin(admin.ModelAdmin):    readonly_fields = [        'tip'    ]    list_display = [        'get_tip',        'url'    ]    @admin.display(description='Tweet Tip ID')    def get_tip(self, link):        return link.tip__all__ = [    'PythonTipLinkAdmin']